import React, { useState, useEffect, useContext } from 'react';
import { useNavigate } from 'react-router-dom';
import { AuthContext } from '../context/AuthContext';
import { getAllJobs } from '../services/api';
import '../styles/Home.css';

function Home() {
  const [jobs, setJobs] = useState([]);
  const [loading, setLoading] = useState(true);
  const { user, logout } = useContext(AuthContext);
  const navigate = useNavigate();

  useEffect(() => {
    fetchJobs();
  }, []);

  const fetchJobs = async () => {
    try {
      const response = await getAllJobs();
      setJobs(response.data.jobs);
      setLoading(false);
    } catch (error) {
      console.error('Error fetching jobs:', error);
      setLoading(false);
    }
  };

  const handleApply = (jobId) => {
    if (!user) {
      navigate('/login');
      return;
    }
    if (user.user_type !== 'job_seeker') {
      alert('Only job seekers can apply to jobs');
      return;
    }
    navigate(`/apply/${jobId}`);
  };

  return (
    <div className="home">
      {/* Navigation Bar */}
      <nav className="navbar">
        <div className="nav-container">
          <h1 className="logo">JobBoard</h1>
          <div className="nav-links">
            {user ? (
              <>
                <span className="welcome">Welcome, {user.full_name}</span>
                <button onClick={() => navigate('/dashboard')} className="btn-nav">
                  Dashboard
                </button>
                <button onClick={logout} className="btn-nav">
                  Logout
                </button>
              </>
            ) : (
              <>
                <button onClick={() => navigate('/login')} className="btn-nav">
                  Login
                </button>
                <button onClick={() => navigate('/register')} className="btn-nav btn-primary">
                  Sign Up
                </button>
              </>
            )}
          </div>
        </div>
      </nav>

      {/* Hero Section */}
      <section className="hero">
        <h1>Find Your Dream Job</h1>
        <p>Connect with top companies and start your career journey today</p>
      </section>

      {/* Jobs Listing */}
      <section className="jobs-section">
        <div className="container">
          <h2>Available Jobs</h2>
          {loading ? (
            <p>Loading jobs...</p>
          ) : jobs.length === 0 ? (
            <p>No jobs available at the moment.</p>
          ) : (
            <div className="jobs-grid">
              {jobs.map((job) => (
                <div key={job.id} className="job-card">
                  <h3>{job.title}</h3>
                  <p className="company">{job.company}</p>
                  <p className="location">üìç {job.location}</p>
                  <p className="job-type">{job.job_type}</p>
                  {job.salary_range && (
                    <p className="salary">üí∞ {job.salary_range}</p>
                  )}
                  <p className="description">{job.description.substring(0, 150)}...</p>
                  <button 
                    onClick={() => handleApply(job.id)} 
                    className="btn-apply"
                  >
                    Apply Now
                  </button>
                </div>
              ))}
            </div>
          )}
        </div>
      </section>
    </div>
  );
}

export default Home;
